import { ParallaxProvider, Parallax } from 'react-scroll-parallax';
const Products = () => (
  <div>
    <Parallax>
      <svg id="rect1" viewBox="0 0 4 4">
        <rect width="40%" height="30%" fill="pink"/>
      </svg>
		</Parallax>
		<style jsx>{`
			#rect1{
				padding-left: 20%;
			}
		`}</style>
  </div>
)
export default Products
